import React, { Component } from 'react';
// import "./logo.css";
class Logo extends Component {
    render() {
        return (
            <div>
                <h1>
                    <div class="veil">
                        <div class="stone"></div>
                        <div class="wand"></div>
                    </div>                    </h1>
            </div>
        );
    }
}

export default Logo;
